26.body:
It turns out that we can partially move fields - just make sure that we don't try to use the struct itself again later. Here, we move the two fields into two different functions. #[derive(Debug)]
struct Person { name: String, alias: String,
} fn main() { let person = Person { name: "John".to_string(), alias: "Johan".to_string(), }; print_alias(person.alias); print_name(person.name);
} fn print_alias(alias: String) { println!("Alias: {:?}!", alias);
} fn print_name(name: String) { println!("Name: {:?}!", name);
}

